import React from 'react'
import experience from './data/dataExperience'

function Experience() {
  return (
    <>
    <section id='experience' className='experience-section'>
      <div className='exp-title
      '>
      <h1>Experience</h1>
      </div>
      <div>
        {experience.map((curElem)=>{
          const{id,position,company,timePeriod,location,skill}=curElem;
          return(
            <div key={id}>
              <div>{position}
              <br />{company}
              <br />{timePeriod}
              <br />{location}
              <br />{skill}</div>
            </div>
          )
        })}
      </div>
      
      
      
    </section>
    </>
  )
}

export default Experience
